const elCartList=document.getElementById("cartList"),elPrixTotal=document.getElementById("prixTotal");var panier=JSON.parse(Cookies.get("cart")),prixTotal=0;Cookies.remove("cart"),panier.forEach(t=>{let e=t.quantite>1?"s":"",i=t.tarif*t.quantite;elCartList.innerHTML+=`<li>${t.titre} - ${t.quantite} ticket${e} (${i}€)</li>`,prixTotal+=i}),elPrixTotal.innerText="Prix total : "+prixTotal.toString()+"€";